import { Card } from "@/components/ui/Card";

const GITHUB_USERNAME = "ckeith26";
const ACCENT_HEX = "10b981";

// Dark-theme contribution palette: very dark green  full accent
const DARK_PALETTE = ["#0d3321", "#115c3b", "#0e9264", "#10b981"];

function sanitizeSvg(raw: string): string {
  const svgMatch = raw.match(/<svg[\s\S]*<\/svg>/);
  if (!svgMatch) return "";
  let svg = svgMatch[0];
  svg = svg.replace(/<script[\s\S]*?<\/script>/gi, "");
  svg = svg.replace(/\bon\w+\s*=\s*"[^"]*"/gi, "");
  svg = svg.replace(/\bon\w+\s*=\s*'[^']*'/gi, "");
  svg = svg.replace(/<foreignObject[\s\S]*?<\/foreignObject>/gi, "");
  return svg;
}

function hexLuminance(hex: string): number {
  const r = parseInt(hex.slice(0, 2), 16);
  const g = parseInt(hex.slice(2, 4), 16);
  const b = parseInt(hex.slice(4, 6), 16);
  return 0.299 * r + 0.587 * g + 0.114 * b;
}

function remapColors(svg: string): string {
  // Replace empty cells
  svg = svg.replace(/fill="#ebedf0"/g, 'fill="#161b22"');

  // Replace text labels
  svg = svg.replace(
    /style="font-size:10px;fill:#000;"/g,
    'style="font-size:10px;fill:#71717a;"'
  );
  svg = svg.replace(/fill="#000"/g, 'fill="#71717a"');

  // Find all remaining unique fill hex colors (these are contribution levels)
  const fills = [...svg.matchAll(/fill="#([0-9a-fA-F]{6})"/g)]
    .map((m) => m[1])
    .filter((c) => c !== "161b22" && c !== "71717a");
  const unique = [...new Set(fills)];

  // Sort by luminance: brightest first = lowest contribution level
  unique.sort((a, b) => hexLuminance(b) - hexLuminance(a));

  // Map each level to our dark palette
  unique.forEach((color, i) => {
    const replacement =
      i < DARK_PALETTE.length
        ? DARK_PALETTE[i]
        : DARK_PALETTE[DARK_PALETTE.length - 1];
    svg = svg.replace(
      new RegExp(`fill="#${color}"`, "g"),
      `fill="${replacement}"`
    );
  });

  return svg;
}

async function fetchContributionSvg(): Promise<{
  svg: string;
  total: number;
} | null> {
  try {
    const res = await fetch(
      `https://ghchart.rshah.org/${ACCENT_HEX}/${GITHUB_USERNAME}`,
      { next: { revalidate: 3600 } }
    );
    if (!res.ok) return null;
    const raw = await res.text();

    let svg = sanitizeSvg(raw);
    if (!svg) return null;

    // Count contributions
    const counts = svg.match(/data-count="(\d+)"/g);
    const total = counts
      ? counts.reduce((sum, match) => {
          const n = parseInt(match.replace(/\D/g, ""), 10);
          return sum + n;
        }, 0)
      : 0;

    // Round squares
    svg = svg.replace(/<rect /g, '<rect rx="3" ry="3" ');

    // Remap all colors for dark theme
    svg = remapColors(svg);

    // Force SVG to stretch to container width
    svg = svg.replace(
      /<svg /,
      '<svg width="100%" preserveAspectRatio="xMinYMid meet" '
    );

    return { svg, total };
  } catch {
    return null;
  }
}

export async function GitHubContributions() {
  const result = await fetchContributionSvg();

  return (
    <Card className="overflow-hidden">
      <div className="flex items-center justify-between mb-4">
        <div>
          <h3 className="text-lg font-semibold text-foreground">
            GitHub Activity
          </h3>
          {result && result.total > 0 && (
            <p className="mt-1 text-sm text-foreground-muted">
              <span className="font-medium text-accent">
                {result.total.toLocaleString()}
              </span>{" "}
              contributions in the last year
            </p>
          )}
        </div>
        <a
          href={`https://github.com/${GITHUB_USERNAME}`}
          target="_blank"
          rel="noopener noreferrer"
          className="text-sm text-foreground-subtle transition-colors hover:text-accent"
        >
          @{GITHUB_USERNAME} &rarr;
        </a>
      </div>
      <div className="overflow-x-auto">
        {result ? (
          <div
            className="w-full min-w-[720px]"
            dangerouslySetInnerHTML={{ __html: result.svg }}
          />
        ) : (
          // eslint-disable-next-line @next/next/no-img-element
          <img
            src={`https://ghchart.rshah.org/${ACCENT_HEX}/${GITHUB_USERNAME}`}
            alt={`${GITHUB_USERNAME}'s GitHub contribution graph`}
            className="w-full min-w-[720px]"
            style={{
              filter:
                "invert(1) hue-rotate(180deg) saturate(1.3) brightness(0.85)",
            }}
          />
        )}
      </div>
    </Card>
  );
}

