function remapColors(svg: string): string {
  // Replace text/label colors for dark theme
  svg = svg.replace(
    /style="font-size:10px;fill:#000;"/g,
    'style="font-size:10px;fill:#71717a;"'
  );
  svg = svg.replace(/fill="#000"/g, 'fill="#71717a"');

  // Collect all contribution counts to determine quartile thresholds
  const countMatches = [...svg.matchAll(/data-count="(\d+)"/g)];
  const nonZeroCounts = countMatches
    .map((m) => parseInt(m[1], 10))
    .filter((n) => n > 0);
  const maxCount = Math.max(...nonZeroCounts, 1);

  // Color each rect based on its data-count value
  svg = svg.replace(
    /(<rect[^>]*data-count="(\d+)"[^>]*?)fill="[^"]*"/g,
    (match, before, countStr) => {
      const count = parseInt(countStr, 10);
      if (count === 0) return `${before}fill="transparent"`;
      const ratio = count / maxCount;
      let level: number;
      if (ratio <= 0.25) level = 0;
      else if (ratio <= 0.5) level = 1;
      else if (ratio <= 0.75) level = 2;
      else level = 3;
      return `${before}fill="${DARK_PALETTE[level]}"`;
    }
  );

  // Also handle rects where fill comes before data-count
  svg = svg.replace(
    /(fill="[^"]*"[^>]*data-count="(\d+)")/g,
    (match, _full, countStr) => {
      const count = parseInt(countStr, 10);
      const color = count === 0 ? "transparent" : DARK_PALETTE[
        count / maxCount <= 0.25 ? 0 :
        count / maxCount <= 0.5 ? 1 :
        count / maxCount <= 0.75 ? 2 : 3
      ];
      return match.replace(/fill="[^"]*"/, `fill="${color}"`);
    }
  );

  return svg;
}

