      svg = svg.replace(
        /<svg/,
        `<svg viewBox="0 0 ${origW} ${origH}"`
      );
    }
    svg = svg.replace(/<svg/, '<svg width="100%"');

    return { svg, total };
  } catch {
    return null;
  }
}

